const api_key = 'b677204d99e9870416faefa56773d56c'

export default async function getSerieVideo({ id }) { 
    const apiURL = 
    `https://api.themoviedb.org/3/tv/${id}/videos?api_key=${api_key}&language=es-ES`

    return fetch(apiURL)
        .then(res => res.json())
        .then(response => {
            const data = response.results
            return data[0]
        })
}
